import React, { Component } from 'react';

class Like extends Component {

    render() { 
        return (
            <i onClick={this.props.ClickHandler} className="fas fa-heart"></i>
        );
    }
    
    SelectClass(){
        return ` fa-heart`
    }
    ClickHandler(){
        this.setState({IsLiked: !this.state.IsLiked})
    }
}
 
export default Like;
